const results = [
	/*0*/["", "Wij hebben uw plant niet kunnen vinden"],
	/*1*/["Mos", "Bryophyta", "Plantje wortelt niet"],
	/*2*/["Hondsdraf", "Glechoma hedracea"],
	/*3*/["Veldereprijs", "Veronica arvensis"],
	/*4*/["Klimopereprijs", "Veronica hederifolia", "Bloemen klein (4-8 mm), lichtpaars, goedzichtbaar, met iets donkerder paarse nerven?"],
	/*5*/["Muurpeper", "Sedum acre", "Vetplantje, vaak meerdere opstijgende stengels bij elkaar als een kussentje. Bladeren 3-6mm."],
	["Stinkende gouwe", "Cheldionium majus", "Plant met oranje melksap, bossig vertakt. Bloemen in losse schermen met 2-8 bloemen. Bloem met 4 kroonbladen."],
	["Melkdistel", " "],
	["Paardenbloem", "Taraxacum officinale", "Bloemen in een hoofdje bij elkaar (samengesteldbloemige)"],
	["Gehoornde klaverzuring", "Oxalis corniculata", "Blad handvormig samengesteld met 3 omgekeerd hartvormige deelblaadjes."],
	["Vijfvingerkruid", "Potentilla reptans", "Bloemen met 5 kroonbladen."]
]

export default results
